/** @jsxImportSource @emotion/react */
import { css } from '@emotion/react';
import EnterButton from './EnterButton';
import StartTime from './StartTime';
import Start2End from './Start2End';
import HouseIcon from '@mui/icons-material/House';
import { IconButton } from '@mui/material';

const roomStyle = css`
    display: flex;

    justify-content: space-between;
    align-items: stretch;

    margin: 2px;
    padding: 6px;
    width: 99%;

    border-radius: 5px;

    background-color: #5CA00C;
    color: #FCF6F5;

    box-shadow: 3px 3px 3px gray;

`;

function MyRoom({ setRejoin, roomData, isInRoom, setIsInRoom, isHost, setIsHost, roomId, setRoomId }) {
    return (
        <div css={roomStyle}>
            <StartTime time={roomData.time} />
            <Start2End start={roomData.start} startLoc={roomData.startLoc} end={roomData.end} endLoc={roomData.endLoc} />
            <div css={css`border: 1px white solid; padding: 6px 8px; width: 46px; height: 26.25px;`}>
                <HouseIcon />
            </div>
        </div>
    )
}

export default MyRoom
